import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

const [event, setEvent] = React.useState('');
const [action1, setaction1] = React.useState('');
const [action2, setaction2] = React.useState('');
const [result, setresult] = React.useState('');

  return (
    <div className="wrapper">
      <main>
        <div className="page">
          <p className="title">What are you thinking?</p>

          <form className="thoughtForm">
            <label htmlFor="event">I'm worried about</label>

            <input 
              type="text" 
              id="event" 
              value={event} 
              onChange={ (e) => { 
                  setEvent(e.target.value) 
                }
              }
              placeholder="An upcoming event"
            />

            <label htmlFor="action1">Because I'm scared I will</label>
            <div className="actions">
              <input type="text" id="action1" value={action1} onChange={
                (e) => { setaction1(e.target.value) }
              }/>

              <label htmlFor="action2">and</label>
              <input type="text" id="action2" value={action2} onChange={
                (e) => { setaction2(e.target.value) }
              }/>
            </div>

            <p>resulting {event ? event :"An upcoming event"}</p>
            <label htmlFor="result">to be</label>

            <input type="text" id="result" value={result} onChange={
              (e) => { setresult(e.target.value) }
            }/>

          </form>
        </div>


      </main>

    </div>
  );
}

export default App;
